import { Link, useNavigate } from "react-router-dom";

export default function Projects() {
  const navigate = useNavigate();

  return (
    <main>
      <h1>Projects</h1>

      <p style={{ paddingTop: "25px" }}>Welcome to the projects page.</p>
      <Link className="link" to="/">Back Home</Link>

      <br/>
      <a className="link" onClick={() => {
        navigate('/EvolutionApp/index.html')
      }}>Evolution App</a>

      <p style={{ paddingTop: "25px" }}>Build several projects demonstrating different technologies. For each profile open source to GitHub with clean code + professional READMEs:</p>
      <ul style={{ padding: "2rem 2rem" }}>
        <li>HTML/CSS/JavaScript project with Basic Javascript algorithm - Snake game, 2D game, minesweeper, maze solver, etc.</li>
        <li>Advanced ReactJS demo - this website! Or similar simple demo project with state, interactivity, cross-browser compatibility, etc.</li>
        <li>Advance NodeJS backend demo (my blog? etc.)</li>
        <li>Alternative coding project - python, machine learning, swift/ios, etc.</li>
      </ul>
    </main>
  );
}
